import PropTypes from 'prop-types'
import React, { Component } from 'react'
import { Nav } from 'react-bootstrap'
import MenuGenres from './MenuGenres'

export class GenreNav extends Component {
  static propTypes = {}

  render() {
    return (
      <Nav>
        <MenuGenres/>
      </Nav>
    )
  }
}

export default GenreNav
